import 'react-native-gesture-handler';
import React, {Component} from 'react'
import {View, Text, StyleSheet, Image, Button, Alert, ImageBackground, 
  TouchableOpacity, TextInput, ScrollView } from 'react-native'
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import Login from './src/Login'
import UserProfile from './src/UserProfile'
import Loading from './src/Loading'
import {AsyncStorage} from '@react-native-async-storage/async-storage'



var appNavigator = createStackNavigator();
class CVRP extends Component {
    render(){
      return(
        <NavigationContainer>
          <appNavigator.Navigator>
            <appNavigator.Screen name="Login" component={Login} />
            <appNavigator.Screen name="UserProfile" component={UserProfile} />
            <appNavigator.Screen name="Loading" component={Loading} />
          </appNavigator.Navigator>
        </NavigationContainer>
      )
    }
}



  export default CVRP
